import React  from 'react';

const Button = (props) =>{
    const{
        type,
        onClick,
        label,
        disabled
      }=props
        

  return(
      <div className="">
      <div
      className={`btn btn-${type} p-2`}
      isDisabled={`${disabled}`}
      onClick={(e)=>{
          if(disabled){
              return
          }
          onClick(e)
      }}
      >
      {label}

      </div>
      </div>
  )
}

Button.defaultProps ={
type:'primary',
disabled:'false'
} 

export default Button;
